import React from 'react';
import { ThemeProvider, Heading } from 'rebass';
import preset from '@rebass/preset'
import './App.css';

function App() {
  return (

    <ThemeProvider theme={preset}>
      <Heading>Hello world</Heading>
    </ThemeProvider>
    // <div className="App">

    // </div>
  );
}

export default App;
